import Social from '../social';
import Text from './text';
import HospitalServices from '../HospitalServices';
import Addbar from '../Addbar';







const Container=styled.div`
display:flex;
flex:1;
aling-items:center;
justify-content:center;
height:100vh;
width:100%;
position:absolute;
top:0;
bottom:0;
margin:auto;
background-color:green;
`;

const Home = () => {
  return (
    <div>
    <Slider />
    <HomeContent />
    <HospitalInfo /><br/>
    <HospitalServices/>


</div>
  );
}

export default Home;
